import React from 'react';
import "./graph.css"

export function Graph({ roiRates }) {
  const yearsRates = Object.values(roiRates)
  const dataRates = yearsRates.map((x) => {
    const initialRate = yearsRates[0]
    return x/initialRate
  })
  const years = Object.keys(roiRates)
  console.log(dataRates)
  return (
    <>
    <div className="columns">
        {dataRates.map((rate) => {
            return (
                <div className="column" style={{height: 50*rate}}></div>
            )
        })}
    </div>
    {years.map((year) => {
            return (
                <div>{year}</div>
            )
        })}
    </>
  )
}
